common.letgoRequest.js:
import { pum } from '@fesjs/fes';
import { FMessage } from '@fesjs/fes-design';
import { createRequest } from '@qlin/request';

export const letgoRequest = createRequest({
    mergeRequest: true,
    mode: 'cors',
    credentials: 'same-origin',
    errorHandler(error) {
        if (error.response.status === 401)
            return pum.redirectToLogin();

        if (error.response) {
            // 请求成功发出且服务器也响应了状态码，但状态代码超出了 2xx 的范围
            FMessage.error(`服务端异常：${error.response.status}`);
        } else if (error.msg) {
            FMessage.error(error.msg);
        } else {
            // 发送请求时出了点问题
            FMessage.error(error.message);
        }
        console.log('request error', error);
    },
});

